import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';

function MyVideo(props) {

    const dispatch = useDispatch()
    const state = useSelector((state)=>{
        return{video:state.video.video}
    })
    useEffect(()=>{

    },[])

    return (
        <div>
        {state.video.map((e)=>(
        <div>
        <h4>{e.titleitems.snippet.title}</h4>
        <hr/>
            <iframe
            width="400"
            height="213"
            src={`https://www.youtube.com/embed/${e.src}`}
            frameBorder="0"
            allow="accelerometer; autoplay; 
            clipboard-write; encrypted-media; gyroscope;
            picture-in-picture"
            allowFullScreen
          />
          <hr/>
          <h6>{e.description}</h6>
          </div>




        ))}

        <button onClick={()=> console.log("this is the other page",state.video.map(e=>e))}>hello its me </button>
        </div>
    );
}

export default MyVideo;
